import { Link } from "react-router-dom";
import logo from "./logo.png"

const Navbar = () => {
  return (
    <nav className="navbar">
      <h1>The new Blog</h1>
      <img src={logo} ></img>
      <div className="links">
        <Link to="/">Home</Link>
        <Link
          to="/create"
          style={{
            color: "white",
            backgroundColor: "#f1356d",
            borderRadius: "5px",
          }}
        >
          New Blog
        </Link>
      </div>
    </nav>
  );
};

export default Navbar;
